import React from 'react';
import './Home.css'; 

function Home() {
  return (
    <div className="container">
      <div className="title">
        <h1>Ari Creations</h1>
      </div>
      <div className="content">
        <div className="article">
          <h2>Hi Hello!</h2>
          <p>Welcome to Our Websites</p>
          <a href="#" className="button">Register Now</a>
        </div>
        <div className="jaanu">
          <img src="logo.png" alt="" />
        </div>
      </div>
    </div>
  );
}

export default Home;
